import React, { useContext } from 'react';
import {Context} from '../Context';
import GridView from './GridView';
import CurrentPlaneView from './CurrentPlaneView';
import InitView from './InitView';
import {BrowserRouter, Route, Switch} from 'react-router-dom';

const Main = () => {
    const {gridView, status} = useContext(Context);

    return ( 
        <BrowserRouter>
        <Switch>
            <Route exact path='/grid' component={GridView} />
            <Route exact path='/info' Component={CurrentPlaneView} />
        </Switch>
            {status === 'Setting up...' ? <InitView /> : gridView ? <GridView /> : <CurrentPlaneView />}
        </BrowserRouter>
     );
}

export default Main;
